  position: relative;
  color: rgba(96, 125, 139, 0.5);
}
[data-grammar*="gfm"]::shadow .markup.strike::after {
  content: "";
  position: absolute;
  top: calc(54%);
  left: 0;
  right: 0;
  height: 1px;
  background-color: rgba(96, 125, 139, 0.2);
}
[data-grammar*="gfm"]::shadow .table .border {
